import React, { useState } from "react";

const Home = props => {
  const [login, setlogin] = useState(false);
  const loginHandel = () => {
    props.login(!login);
  };
  return (
    <div>
      welcome to home ! login::{login}
      <br></br>
      <button onClick={loginHandel.bind(this)}>login</button>
    </div>
  );
};
export default Home;
